	('vyt5c94d45a0ab570.95234477','zxtR00850C4','1\n00:00:08,360 --> 00:00:11,200\nI used to believe\n\n2\n00:00:11,320 --> 00:00:14,680\nWe were burnin\' on the edge of somethin\' beautiful\n\n3\n00:00:15,760 --> 00:00:17,840\nSomethin\' beautiful\n\n4\n00:00:18,240 --> 00:00:20,120\nSelling a dream\n\n5\n00:00:20,680 --> 00:00:25,580\nSmoke and mirrors keep us waitin\' on a miracle\n\n6\n00:00:25,600 --> 00:00:27,580\nOn a miracle\n\n7\n00:00:28,320 --> 00:00:31,140\nSay, go through the darkest of days\n\n8\n00:00:31,140 --> 00:00:33,200\nHeaven\'s a heartbreak away\n\n9\n00:00:33,720 --> 00:00:36,920\nNever let you go, never let me down\n\n10\n00:00:37,440 --> 00:00:42,920\nOh, it\'s been a hell of a ride\nDriving the edge of a knife\n\n11\n00:00:42,920 --> 00:00:47,140\nNever let you go, never let me down\n\n12\n00:00:47,280 --> 00:00:50,080\nDon\'t you give up, nah-nah-nah\n\n13\n00:00:50,120 --> 00:00:52,060\nI won\'t give up, nah-nah-nah\n\n14\n00:00:52,200 --> 00:00:55,800\nLet me love you\nLet me love you\n\n15\n00:00:56,200 --> 00:01:01,640\nDon\'t you give up, nah-nah-nah\nI won\'t give up, nah-nah-nah\n\n16\n00:01:01,780 --> 00:01:06,300\nLet me love you\nLet me love you\n\n','2019-03-22 20:26:02','vyt5c93bdfc8caf15.08753899',NULL,'vyt5c94d4142f1573.53281054'),
